import React from 'react';
import { Layout, Icon, Menu, Row,Col } from 'antd';
import {NavLink} from 'react-router-dom';
// import LeftBar from "../common/leftbar/index";
// import RightTop from "../common/rightTop/index";
const { Header, Sider, Content } = Layout;
// const { Content } = Layout;

class Protal extends React.Component {
  state = {
    collapsed: false,
  };

  toggle = () => {
    this.setState({
      collapsed: !this.state.collapsed,
    });
  }

  render() {
    return (
      // <Layout>
      //   <LeftBar></LeftBar>
      //   <Layout>
      //     <RightTop></RightTop>
      //     <Content style={{
      //       margin: '24px 16px', padding: 24, background: '#fff', minHeight: 280,
      //     }}
      //     >
      //       Content
      //     </Content>
      //   </Layout>
      // </Layout>
      <Layout>
        <Sider
          trigger={null}
          collapsible
          collapsed={this.state.collapsed}
        >
          <div className="logo" />
          <Menu theme="dark" mode="inline" defaultSelectedKeys={['1']} style={{height:"100%"}}>
            <Menu.Item key="1">
              <Icon type="user" />
              <span> 
                <NavLink to="/articleLists">文章列表</NavLink>
              </span>
            </Menu.Item>
            <Menu.Item key="2">
              <Icon type="video-camera" />
              <span>nav 2</span>
            </Menu.Item>
            <Menu.Item key="3">
              <Icon type="upload" />
              <span>nav 3</span>
            </Menu.Item>
          </Menu>
        </Sider>
        <Layout>
          <Header style={{ background: '#fff', padding: 0 }}>
            <Icon
              className="trigger"
              type={this.state.collapsed ? 'menu-unfold' : 'menu-fold'}
              onClick={this.toggle}
            />
          </Header>
          <Content style={{
            margin: '24px 16px', padding: 24, background: '#fff', minHeight: 280,
          }}
          >
            <Row>
              <Col span={8}>col-8</Col>
              <Col span={8}>col-8</Col>
              <Col span={8}>col-8</Col>
            </Row>
          </Content>
        </Layout>
      </Layout>
    );
  }
}

export default Protal;
